import React from "react";
import { createBrowserRouter, RouterProvider } from 'react-router-dom';


/**import all components */
import Username from './components/Profile';
import Password from './components/Password';
import Register from './components/Profile';
import Profile from './components/Profile';
import Recovery from './components/Recovery';
import Reset from './components/Reset';
import PageNotFound from './components/PageNotFound';

/**root routes */
const router = createBrowserRouter([
    {
        path : '/',
        element : <Username>Root Router</Username>
    },
    {
        path : '/register',
        element : <Register>Register Route</Register>
    },
    {
        path : '/password',
        element : <Password>Root Router</Password>
    },
    {
        path : '/profile',
        element : <Profile>Root Router</Profile>
    },
    {
        path : '/password',
        element : <Password>Root Router</Password>
    },
    {
        path : '/recovery',
        element : <Recovery>Root Router</Recovery>
    },
    {
        path : '/Reset',
        element : <Reset>Root Router</Reset>
    },
    {
        path : '*',
        element : <PageNotFound>Root Router</PageNotFound>
    }
    
])

export default function App() {
    return (
        
        <main> 
           <RouterProvider router={router}></RouterProvider>
        </main>
    )
}
